import React from 'react';
import './whatGPT3.css';
import {Feature} from "../../components";

const WhatGPT3 = () => {
  return (
    <div className="gpt3__whatgtp3 section__margin " id="wgpt3">

      <div className="gpt__whatgtp3-feature">
        <Feature/>
      </div>
      <div className="gpt3__whatgtp3-heading">
        <h1 className="gradient__text"></h1>
      </div>
    </div>
  )
}

export default WhatGPT3
